function websocketMessage(event) {
  var resp = JSON.parse(event.data);
  console.log('Message from server ', resp);
  if (resp.type == "message") {
    renderMessages([resp], false)
  } else if (resp.type == "pong") {
    // fine
  } else if (resp.type == "reconnect_url") {
    websocket_url = resp.url
  } else if (resp.type == "error") {
    console.log("reconnecting to websocket");
    websocket.close();
    startWebsocket();
  } else if(resp.type == "reaction_added") {
    show_reaction(resp.reaction, resp.item.channel, resp.item.ts, resp.user);
  } else if(resp.type == "reaction_removed") {
    remove_reaction(resp.reaction, resp.item.channel, resp.item.ts, resp.user);
  } else {
    console.log("TODO: unhandled message type: ", resp.type);
  }

};

function sendSocket(messageObj) {
  websocket.send(JSON.stringify(messageObj));
}

function websocketPing() {
  console.log("pinging websocket");
  sendSocket({
    type: "ping",
    id: gbl_message_id++
  });
}

function startWebsocket() {
  console.log("websocket_url", websocket_url);
  if(websocket) {
    console.log("already got WebSocket");
    return;
  }
  websocket = new WebSocket(websocket_url);
  websocket.addEventListener('message', websocketMessage);
  setInterval(websocketPing, 4000);
}


